import React, { Component } from 'react';
import { useParams } from "react-router-dom";
import axios from 'axios'
import Map from '../components/MapTest'
import Marks from '../components/Marks'

export default class Region extends Component {
    state = {
        reg: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/regiones')
            .then(res => {
                const reg = res.data;
                this.setState({ reg });
            })
    }

    render() {
        const { reg } = this.state
        const { index} = this.props
        return (
            <div>
                <h1>{index}</h1>
                <Use
                    list={reg}
                />
            </div>
        )
    }
}

function Use(props) {
    let { id } = useParams();
    const zoomR = 13
    const heightP = 300
    const coordenadas = [-41.471667, -72.936667]

    return (
        <div>
            <Map
                position={coordenadas}
                height={heightP}
                zoom={zoomR}
                idParams={id}
            />
            <Region
                index={id}
            />

        </div>
    );
}
